script: |
  super -f text -I q6123.spq | sort > q6123.out

inputs:
  - name: q6123.spq
    data: |
      SELECT col2 + - col1 * 38 col2 FROM tab1 (FORMAT parquet) WHERE col1 / 38 BETWEEN + CAST ( NULL AS REAL ) * + 89 * + 92 + col2 AND col0 * + col2;
  - name: tab1

outputs:
  - name: q6123.out
    data: |
